INSERT INTO `v1_a5147172f095624db8d4ea4ea42c3893739aafc894bb16b64d816116d0ff9ae6` VALUES (321, 1, 1, "もうすぐ、みなさまに\nお会いできるのですね。\n胸が高鳴ってしまいます……\n", 125801, 24001, 1, 0, 40011, "リリ", 2);
INSERT INTO `v1_a5147172f095624db8d4ea4ea42c3893739aafc894bb16b64d816116d0ff9ae6` VALUES (322, 1, 2, "初めまして、クリアです♪\nみなさんと一緒に冒険するの\nとっても楽しみにしてます", 126001, 24001, 1, 0, 40011, "クリア", 2);
INSERT INTO `v1_a5147172f095624db8d4ea4ea42c3893739aafc894bb16b64d816116d0ff9ae6` VALUES (323, 1, 3, "んーと。\nこれ、あげる。\nはい", 126101, 24001, 1, 0, 40011, "プレシア", 2);
INSERT INTO `v1_a5147172f095624db8d4ea4ea42c3893739aafc894bb16b64d816116d0ff9ae6` VALUES (324, 1, 4, "あらためまして……\n【アルターメイデン】の\nギルドマスター、リリと申します", 125801, 24001, 2, 0, 40011, "リリ", 2);
INSERT INTO `v1_a5147172f095624db8d4ea4ea42c3893739aafc894bb16b64d816116d0ff9ae6` VALUES (325, 1, 5, "こんにちは、お兄さん♪\n【アルターメイデン】の\nクリアです", 126001, 24001, 2, 0, 40011, "クリア", 2);
INSERT INTO `v1_a5147172f095624db8d4ea4ea42c3893739aafc894bb16b64d816116d0ff9ae6` VALUES (326, 1, 6, "お兄。\nきてくれて、うれしい", 126101, 24001, 2, 0, 40011, "プレシア", 2);
